  [],\n\t\"revision_timestamp\": \"2016-08-20T09:39:31.149988\",\n\t\"name\": \"hanford-reach-highway-24-homestead-reclamation-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Highway 24 Homestead project is a multi-year
  reclamation effort in part designed to address habitat degradation and hazardous
  fuels issues in part caused by past land uses and by sub-surface leaching of irrigation
  wastewater. This increased out-of-season moisture has altered the hydrology and
  soil chemistry of the project area, allowing kochia and other invasive broadleaf
  weeds (including smotherweed, tumble mustard, and two species of Russian thistle)
  to invade and outcompete the stressed native shrub-steppe habitats. In particular,
  spiny hopsage (Grayia spinosa), and its associated subshrubs, forbs, and short grasses
  have all begun to die out. Most of the native forbs and grasses are currently extirpated
  from much of the core project area. Since the irrigation is both administratively
  and legislatively protected, the only viable option is to treat the invasive components
  and introduce native species better suited to the modified site conditions. The
  multi-year prescription that was developed for this site involves mowing existing
  standing weeds and detritus, burning the area, chemically treating the invasive
  components using a rotational, multiple mode-of-action series of herbicide applications,
  and then progressively seeding in selected native grasses, forbs, and sub-shrubs
  and shrubs. The funds from the FY2012 Invasive Species Control grant, used to supplement
  hazardous fuels reduction funds, and supplemented by other funding sources (e.g.,
  station funds), were used to complete some of the early steps of this prescription.
  Photopoints were established in the project area and adjacent lands, most of the
  project area was burned in spring 2012 (with the remainder to be burned in spring
  2013), broadleaf annuals and cheatgrass were chemically treated in the whole of
  the project area in summer and late fall 2012, and native grass seed was procured
  for application in winter 2012/2013. Future reclamation work will include completion
  of the burn, continued broadleaf control, and seeding and/or planting of native
  grasses, forbs, sub-shrubs, and shrubs.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
